<h1>details</h1>
<h2>カーボン製の12本骨</h2>
<div id="carbon">
<a href="https://image.rakuten.co.jp/komiyakasa/cabinet/ladies_umbrellas/img62706446.jpg" target="_blank">
<img src="https://image.rakuten.co.jp/komiyakasa/cabinet/ladies_umbrellas/img62706446.jpg" alt="カーボン骨" class="ph" width="200" height="140"></a>

<p class="data">軽量で硬質なため飛行機の部品などにも使われ、非常に高価な素材です。<br>
この傘の重量は345ｇ。12本の骨でこの軽さは驚きです！
骨の素材についてのご案内は<a href=https://item.rakuten.co.jp/komiyakasa/c/0000000172/>こちら</a></div>



<h2>傘専用の甲州織生地</h2>
<div id="kousyuuori">
<a href="https://image.rakuten.co.jp/komiyakasa/cabinet/ladies_umbrellas/img62705923.jpg" target="_blank">
<img src="https://image.rakuten.co.jp/komiyakasa/cabinet/ladies_umbrellas/img62705923.jpg" alt="kousyuuori" class="ph" width="200" height="140"></a>

<p class="data">傘専用の生地として傘の幅に合わせて織られているので、
一般の傘のようにミシン目がありません。
<br>傘の淵には、織り方が異なる「ミミ」と呼ばれる部分があり、アクセントになっています。<br>

※この傘は表と裏が同じ色（シングル組織）です。
<br>両面で色が異なる二重織の生地を使った
甲州織　両面無地傘「かさね」は<a href=https://item.rakuten.co.jp/komiyakasa/995306-51/>こちら</a>

</p></div>



<h2>手元</h2>
<div id="temoto">
<a href="https://image.rakuten.co.jp/komiyakasa/cabinet/ladies_umbrellas/img62705917.jpg" target="_blank">
<img src="https://image.rakuten.co.jp/komiyakasa/cabinet/ladies_umbrellas/img62705917.jpg" alt="temoto" class="ph" width="200" height="140"></a>


<p class="data">国産木材を使用した合板材です。
<br>女性の手に程よくフィットするよう、わずかにカーブを付けています。</p></div>






<h2>ダボ・ろくろ包み</h2>
<div id="rokuro">
<a href="https://image.rakuten.co.jp/komiyakasa/cabinet/ladies_umbrellas/img62705918.jpg" target="_blank">
<img src="https://image.rakuten.co.jp/komiyakasa/cabinet/ladies_umbrellas/img62705918.jpg" alt="rokuro" class="ph" width="200" height="140"></a>

<p class="data">傘の開閉時に上げ下げする「ろくろ」部分を生地で包んでいます。<br>
お客様が傘を開閉する際に指が痛くならないように、<br>
細かい部分にも小宮商店のこだわりを込めて作っています。</p></div>


<p><a href="https://item.rakuten.co.jp/komiyakasa/10000113-1/"><IMG src="https://image.rakuten.co.jp/komiyakasa/cabinet/ladies_umbrellas/imgrc0069603674.jpg"></a></p>


<h3>
<FONT color="#666666" size="5" face="メイリオ" >    
About KOMIYA
<hr align="left" width="600"></h3>




<div id="temoto">
<IMG src="https://image.rakuten.co.jp/komiyakasa/cabinet/03279572/img59916775.jpg" class="ph">


<p class="komiyadata">小宮商店は昭和5年の創業以来、東京・東日本橋で洋傘の製造販売を行っている会社です。
かつては隆盛を誇った傘屋も今はずいぶん少なくなり、我々のような傘専門のメーカーは極わずか
になりました。
<br>
当社には自社内に作業場があり、オプション作業やオーダーメイド、メンテナンス等のアフターケアも随時行っています。</p></div>



<div id="temoto">
<p class="komiyadata">小宮商店の職人の仕事は、全て職人とその奥さんとの共同作業で成り立っています。
裁断、ミシン、縫製等、息の合った２人による和の手仕事で、どちらが欠けても小宮の傘はできあがりません。まさに「夫婦技」です。</p>
<IMG src="https://image.rakuten.co.jp/komiyakasa/cabinet/03279572/img59916776.jpg"class="ph2"><br></div>



<div id="temoto">
<img src="https://image.rakuten.co.jp/komiyakasa/cabinet/ladies_umbrellas/img59916844.jpg" class="ph"><br>
<p class="komiyadata">小宮商店は「日本洋傘振興協議会（ＪＵＰＡ）」の会員企業である当社の傘には、
品質・信頼・安心の裏付けとしてこのマークがついています。<br>
会員NO.1115のタグは当社で製造した証ですので、末永くお使いいただくためのアフターケアはお任せください。</p></div>






<div id="temoto">
<img src="https://image.rakuten.co.jp/komiyakasa/cabinet/ladies_umbrellas/img59916843.jpg" class="ph2">
<p class="komiyadata">
当社には、ＪＵＰＡが認定するアンブレラマスターが７人在籍しています。
<br>洋傘販売のスペシャリスト、いわば傘のプロ集団である我々が、商品の検品、梱包を全て自社で行います。</p></div>












